import React, { Component } from 'react';
import logo from './logo.svg';
import heartOn from './heart-on.png';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          {/* <img src={logo} className="App-logo" alt="logo" /> */  }

          <div className="Side-bar-container">
            <div className="Hearts-bar" id="Side-bar">
              <img src={heartOn} className="Heart-icon" alt="heart icon" />    
            </div>
            <div className="Stars-bar" id="Side-bar"></div>
          </div>

          <div className="Box"></div>
        </header>
      </div>
    );
  }
}

export default App;
